//function Pl_Hl_Eligible(SIPrate, SIPperiods, SIPpayment, value, type) {
function Pl_Hl_Eligible() {

    var inputSalary = $('.inputSalary').val().replace(/,/g, '');
    var inputEMI = parseInt($('.inputEMI').val().replace(/,/g, ''));
    var inputCard = parseInt($('.inputCard').val().replace(/,/g, ''));
    inputCard = inputCard * 0.05;

    //console.log('>>>>>>'+SIPrate+'-'+SIPperiods+'-'+SIPpayment+'-'+value+'-'+type+'-');
    var type = 0;
    var value = 0;
    var rate = parseFloat(15 / 100 / 12); //parseFloat(15.5 / 100 / 12);
    var periods = parseInt(60);
    var payment = parseInt(inputSalary);

    var type = (typeof type === 'undefined') ? 0 : type;
    rate = eval(rate);
    var result;

    //formula : function PMT(i, n, p) {
    //    return i * p * Math.pow((1 + i), n) / (1 - Math.pow((1 + i), n));
    //}

    var term = Math.pow(1 + rate, periods);

    //result = Math.round(value * term + payment * (term - 1) / rate);
    //console.log(inputCard);
    result = rate * 100000 * Math.pow((1 + rate), periods) / (1 - Math.pow((1 + rate), periods));

    result = ((payment * appFOIR) - (inputEMI + inputCard)) / result * 100000;
    return -result;
}

