 function GetParameterValues(param) {
     var url = window.location.href.slice(window.location.href.indexOf('?') + 1).split('&');
     for (var i = 0; i < url.length; i++) {
         var urlparam = url[i].split('=');
         if (urlparam[0] == param) {
             return decodeURIComponent(urlparam[1]);
         }
     }
 }
 var utm_source = GetParameterValues('utm_source') == undefined ? "" : GetParameterValues('utm_source');
 var utm_medium = GetParameterValues('utm_medium') == undefined ? "" : GetParameterValues('utm_medium');
 var utm_content = GetParameterValues('utm_content') == undefined ? "" : GetParameterValues('utm_content');
 var utm_campaign = GetParameterValues('utm_campaign') == undefined ? "" : GetParameterValues('utm_campaign');
 var utm_keyword = GetParameterValues('utm_keyword') == undefined ? "" : GetParameterValues('utm_keyword');

 function InsertLead()
 {
     $("#pleligibilitysubmit").attr("disabled", true);
     var Fullname = $('#FirstName').val();
     var Email = $('#Email').val();
     //var DepositeAmt = $('#DepositAmount').val();
     //var City = $('#selCity').val();
     //var DOB = "";
     var Mobile = $('#Mobile').val();
     var Pan = $('#Pan').val();
     var PinCode = $('#pincode').val();
     var day = $('#ddldate').val();
     var month = $('#ddlmonth').val();
     var year = $('#ddlyear').val();
     //var DOB =  + "-" + month + "-" + day;
     var DOB = month + "/" + day + "/" + year;
     var employer = $('#comapnytags').val();
     var Salary = $('#Salary').val();

     var pagename = window.location.pathname;

     var pArray = pagename.split('/');

     if (pArray.length > 0) {
         pagename = pArray[pArray.length - 1];
     }
     //alert(document.URL.split("/").pop());
     //var assurl = "high_return_money_investment_plan.aspx";
     $.ajax({
         type: "GET",
         url: '/umbraco/surface/PersonalLoanEligibilityCalculator/SubmitMiniLeadForm',
         async: false,
         data: {
             action: "SubmitMiniLeadForm",
             name: Fullname,
             email: Email,
             //DepositeAmt: DepositeAmt,
             //City: City,
             dob: DOB,
             mobile: Mobile,
             pagename: pagename,
             employer: employer,
             salary: Salary,
             pincode: PinCode,
             panno: Pan,
             utm_source :utm_source,
             utm_medium : utm_medium,
             utm_content :utm_content,
             utm_campaign :utm_campaign,
             utm_keyword: utm_keyword
         },
         success: function (res) {
             var json = JSON.parse(res);
             //alert(json.status);

             if (json.resumeURL != '' && json.resumeURL != null) {
                 window.location.href = json.resumeURL;
             }
             else {
                 $('#first,#second').addClass('formmove');
                 $('#first').css('opacity', '0');
                 $('#second').show();
             }

         },
         error: function (response) { console.log('Failure :' + response); }
     });

 }